import { ToggleBtnGroup } from "intelli-ui-components-library";
import { SetStateAction, useState} from 'react';
import SelectionTab from "../../components/SelectionTab";
import styles from './home.module.scss';

const Home:React.FC = () => {
    const [selectedTab, setSelectedTab] = useState("about");
    const Tabs = [
        {
            name:"About",
            value:"about"
        },
        {
            name:"Upload",
            value:"upload"
        },
        {
            name:"Header",
            value:"header"
        },
        {
            name:"Server",
            value:"server"
        },
        {
            name:"Security",
            value:"security"
        },
        {
            name:"Tags",
            value:"tags"
        },
        {
            name:"Main",
            value:"main"
        },
        {
            name:"Schemas",
            value:"schemas"
        },
        {
            name:"Wizards",
            value:"wizards"
        },
        {
            name:"Export JSON",
            value:"json"
        },
        {
            name:"Export YAML",
            value:"yaml"
        }

    ]
    const clickHandle = (e: { target: { value: SetStateAction<string>; }; }) => {
          setSelectedTab(e.target.value);
      };
    return(
        <div className={`${styles["nav-position"]}`}>
           <ToggleBtnGroup
                onToggle={clickHandle}
                selectedTab={selectedTab}
                shouldSelectByDefault={true}
                borderBottom={false}
                disabled
                styleObj={{
                bgColor: "#00b8d9",
                color: "#00b8d9",
                borderColor: "#00b8d9",
                }}
            >
            {
                Tabs.map(({name,value})=>{
                return <ToggleBtnGroup.Btn value={value}>{name}</ToggleBtnGroup.Btn>
                })
            }
            </ToggleBtnGroup>
            <SelectionTab selected={selectedTab}/>
        </div>
    )
}
export default Home;
